import "./categories.styles.scss";
function App() {
  const categories = [
    {
      id: 1,
      title: "Womens",
      imageUrl: "./src/assets/womens.jpg",
    },
    {
      id: 2,
      title: "Mens",
      imageUrl: "./assets/mens.jpeg",
    },
    {
      id: 3,
      title: "Accessories",
      imageUrl: "../assets/accessories.jpeg",
    },
    {
      id: 4,
      title: "Shoes",
      imageUrl: "../assets/shoes.jpeg",
    },
    {
      id: 5,
      title: "Kids",
      imageUrl: "./assets/kids.jpeg",
    },
  ];

  return (
    <div className="categories-container">
      {categories.map(({ title, id, imageUrl }) => (
        <div key={id} className="category-container">
          <div
            className="background-image"
            style={{
              backgroundImage: `url(${imageUrl})`,
            }}
          />
          <div className="category-body-container">
            <h2>{title}</h2>
            <p>Shop Now</p>
          </div>
        </div>
      ))}
    </div>
  );
}

export default App;
